The <a href="http://www.songfacts.com/detail.php?id=27220" rel="nofollow">This Kiss Songfacts</a> reports that Carly wrote the song with <a href="http://www.last.fm/music/LMFAO" class="bbcode_artist">LMFAO</a> 's RedFoo and her boyfriend, singer-songwriter Matthew Koma. Regarding collaborating with RedFoo, she told MTV News. &quot;It's really neat. We made friends and started working on a song together, and we actually started working on a majority of that song over the phone.”
 She added: &quot;[The sound is] definitely in my vein, but he's a really brilliant guy, and I think if anything when a collaboration happens, it's a little bit of everybody that makes it what it is. So maybe not just me and not just him, but us together.&quot; 


